script: |
  super -f text -I q9577.spq | sort > q9577.out

inputs:
  - name: q9577.spq
    data: |
      SELECT col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE 35 NOT BETWEEN + col0 AND ( - - col2 * - - 0 * ( - col2 ) - + 77 );
  - name: tab1

outputs:
  - name: q9577.out
    data: |
      59
      68
      96
